import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Default route - redirects to signin */}
        <Route 
          path="/" 
          element={<Navigate to="/signin" />} 
        />

        {/* Sign in page route */}
        <Route 
          path="/signin" 
          element={<SignIn />} 
        />

        {/* Sign up page route */}
        <Route 
          path="/signup" 
          element={<SignUp />} 
        />

        {/* Dashboard route (after authentication) */}
        <Route 
          path="/dashboard" 
          element={<Dashboard />} 
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
